import React, { useState } from 'react';
import './App.css';
import { Users, TrendingUp, MessageSquare, Brain, DollarSign, Target, BookOpen, FileText, Package, Gamepad2, UserPlus, BarChart3, Megaphone, FileBarChart, Shield, Settings, Menu, X, Home } from 'lucide-react';

const App: React.FC = () => {
  const [activeModule, setActiveModule] = useState('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(true);

  const modules = [
    { id: 'dashboard', name: 'Dashboard', icon: Home, color: '#00D563' },
    { id: 'team', name: 'Team', icon: Users, color: '#FF0099' },
    { id: 'tgstat', name: 'TGStat', icon: MessageSquare, color: '#0088CC' },
    { id: 'ai', name: 'AI Assistant', icon: Brain, color: '#9333EA' },
    { id: 'finance', name: 'Finance', icon: DollarSign, color: '#10B981' },
    { id: 'kpi', name: 'KPI', icon: Target, color: '#F59E0B' },
    { id: 'knowledge', name: 'Knowledge', icon: BookOpen, color: '#3B82F6' },
    { id: 'resume', name: 'Resume', icon: FileText, color: '#EC4899' },
    { id: 'product', name: 'Product', icon: Package, color: '#8B5CF6' },
    { id: 'players', name: 'Players', icon: Gamepad2, color: '#14B8A6' },
    { id: 'affiliate', name: 'Affiliate', icon: UserPlus, color: '#F97316' },
    { id: 'analytics', name: 'Analytics', icon: BarChart3, color: '#06B6D4' },
    { id: 'marketing', name: 'Marketing', icon: Megaphone, color: '#EF4444' },
    { id: 'reports', name: 'Reports', icon: FileBarChart, color: '#84CC16' },
    { id: 'security', name: 'Security', icon: Shield, color: '#DC2626' },
    { id: 'settings', name: 'Settings', icon: Settings, color: '#6B7280' }
  ];

  const renderContent = () => {
    const module = modules.find(m => m.id === activeModule);
    const Icon = module?.icon || Home;

    if (activeModule === 'dashboard') {
      return (
        <div className="dashboard">
          <h1>CEO Dashboard - lilbet</h1>
          <div className="stats-grid">
            <div className="stat-card">
              <h3>Total Revenue</h3>
              <p className="stat-value">$12.5M</p>
              <span className="stat-change positive">+15.3%</span>
            </div>
            <div className="stat-card">
              <h3>Active Players</h3>
              <p className="stat-value">48,392</p>
              <span className="stat-change positive">+8.7%</span>
            </div>
            <div className="stat-card">
              <h3>GGR</h3>
              <p className="stat-value">$3.2M</p>
              <span className="stat-change positive">+12.1%</span>
            </div>
            <div className="stat-card">
              <h3>New Users</h3>
              <p className="stat-value">5,847</p>
              <span className="stat-change negative">-2.3%</span>
            </div>
          </div>
          <div className="quick-actions">
            <h2>Quick Actions</h2>
            <div className="action-grid">
              {modules.slice(1, 7).map((mod) => {
                const ModIcon = mod.icon;
                return (
                  <button
                    key={mod.id}
                    className="action-card"
                    onClick={() => setActiveModule(mod.id)}
                    style={{ borderColor: mod.color }}
                  >
                    <ModIcon size={32} style={{ color: mod.color }} />
                    <span>{mod.name}</span>
                  </button>
                );
              })}
            </div>
          </div>
        </div>
      );
    }

    return (
      <div className="module-content">
        <div className="module-header">
          <Icon size={48} style={{ color: module?.color }} />
          <h1>{module?.name}</h1>
        </div>
        <div className="module-placeholder">
          <p>Модуль {module?.name} в разработке</p>
          <div className="feature-preview">
            <h3>Планируемый функционал:</h3>
            <ul>
              <li>Управление и аналитика</li>
              <li>Отчеты и дашборды</li>
              <li>AI-powered инсайты</li>
              <li>Интеграция с внешними системами</li>
            </ul>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className="app">
      <div className={`sidebar ${sidebarOpen ? 'open' : 'closed'}`}>
        <div className="sidebar-header">
          <h2>{sidebarOpen && 'LilCopilGit'}</h2>
          <button className="toggle-btn" onClick={() => setSidebarOpen(!sidebarOpen)}>
            {sidebarOpen ? <X size={24} /> : <Menu size={24} />}
          </button>
        </div>
        <nav className="sidebar-nav">
          {modules.map((module) => {
            const Icon = module.icon;
            return (
              <button
                key={module.id}
                className={`nav-item ${activeModule === module.id ? 'active' : ''}`}
                onClick={() => setActiveModule(module.id)}
                style={{ '--accent-color': module.color } as React.CSSProperties}
              >
                <Icon size={20} />
                {sidebarOpen && <span>{module.name}</span>}
              </button>
            );
          })}
        </nav>
      </div>
      <main className="main-content">
        {renderContent()}
      </main>
    </div>
  );
};

export default App;
